import React from "react";
import { BrowserRouter as Router, Switch, Route, useRouteMatch, Link } from "react-router-dom";
import routes from "./config/routes";

function App(props) {





  return (
    <Router>
      <Switch>
      const RoutesRender = ({ Routes, Key}) => {
      <Route exact key={Key} path={Routes.Path} render={(props) => <Routes.Component {...props} />}></Route>
      };
      </Switch>
    </Router>
  );
}

function RouteWithSubRoutes(route, Key) {
  console.log(route.routes);
  return (
    <Route exact key={Key} path={route.Path} render={(props) => <route.Component {...props} />}></Route>
  );
}




export default App;
